    {
        var commaMatch = value.search("\\,");
        while(commaMatch != -1)
        {
            value = value.substr(0, commaMatch) + value.substr(commaMatch+1);
            commaMatch = value.search("\\,");
        }
        return value;
    }

    function getFirstNumberPosition(value)
    {
        var position = -1;
        var valueSize = value.length;
        var counter  = 0;
        while(valueSize > counter)
        {
            if ($.isNumeric(value[counter]))
            {
                return counter;
            }
            counter++
        }
        return position;
    }

    function addPoints(value)
    {
        var valueSize = value.length;
        if(valueSize > 3)
        {
            var residual = valueSize%3;
            var quotient = (valueSize - residual)/3;
            var pointCounter = 0;
            var quotientActualPosition = 3;
            if (residual > 0)
            {
                value = value.substr(0, residual) + '.' + value.substr(residual);
                pointCounter++;
                quotientActualPosition = quotientActualPosition + residual;
            }
            while(valueSize > quotientActualPosition)
            {
                value = value.substr(0, quotientActualPosition+pointCounter) + '.' + value.substr(quotientActualPosition+pointCounter);
                quotientActualPosition += 3;
                pointCounter++;
            }
            return value;
        }
        else
        {
            return value;
        }
    }

    function format_number(value, type)
    {
        var newValue = "";
        var pointMatcher = value.match("\\.");
        var integers = "";
        var integers_label = "";
        var integers_digits = "";
        var decimals = "";
        var firstNumberPosition;
        if(value == "")
        {
            value = "sin valor";
            return value;
        }
        if(pointMatcher == null)
        {
            integers = value;
            integers = deleteCommas(integers);
        }
        else if (pointMatcher.length == 1)
        {
            var tempArray = value.split("\.");
            integers = tempArray[0];
            decimals = tempArray[1];
            integers = deleteCommas(integers);
        }
        else
        {
            alert("formato desconocido");
        }
        firstNumberPosition = getFirstNumberPosition(value);
        if (firstNumberPosition != -1)
        {
            integers_label = integers.substr(0, firstNumberPosition);
            integers_digits = integers.substr(firstNumberPosition);
            integers_digits = addPoints(integers_digits);
            if((decimals == "") && (type != "formattedText"))
            {
                newValue = integers_label + integers_digits + ",00";
            }
            else if(type == "formattedText")
            {
                newValue = integers_label + integers_digits;
            }
            else
            {
                var decimalSize = decimals.length;
                var lastdecimalValue = $.isNumeric(decimals[decimalSize-1]);
                if(decimalSize > 2)
                {
                    if (!lastdecimalValue)
                    {
                        newValue = integers_label + integers_digits + "," + decimals[0] + decimals[1]+ decimals[decimalSize-1];
                    }
                    else
                    {
                        newValue = integers_label + integers_digits + "," + decimals[0] + decimals[1];
                    }
                }
                else if(decimalSize == 2)
                {
                    if (!lastdecimalValue)
                    {
                        newValue = integers_label + integers_digits + "," + decimals[0] + "0" + decimals[1];
                    }
                    else
                    {
                        newValue = integers_label + integers_digits + "," + decimals[0] + decimals[1];
                    }
                }
                else
                {
                    if (!lastdecimalValue)
                    {
                        newValue = integers_label + integers_digits + ",00" + decimals[0];
                    }
                    else
                    {
                        newValue = integers_label + integers_digits + "," + decimals[0] + "0";
                    }
                }
            }
            return newValue;
        }
        else
        {
            alert("formato desconocido");
        }
    }

    var formatPercentage = function(val) 
    {
        var valor =""+val;
        var buscador;
        buscador = valor.search("\.");
        if(buscador != -1)
        {
            valor = valor.replace("\.", "\,");
        }
        var todo = valor.split("\,");
        var unidades = todo[0];
        var totalUnidades = unidades.length;
        var listaLetras = unidades.split('');
        var residuo = totalUnidades%3;
        var cociente = (totalUnidades-residuo)/3;
        var nuevasUnidades = "";
        if(cociente > 0)
        {
            var temp = 0;
            if(residuo > 0)
            {
                while(temp < residuo)
                {
                    nuevasUnidades += listaLetras[temp];
                    temp++;
                }
                nuevasUnidades += ".";
            }
            if (totalUnidades-residuo > 3)
            {
                var contadorTres = 3;
                while(temp < totalUnidades)
                {
                    nuevasUnidades += listaLetras[temp];
                    if((contadorTres == 1)&&((temp+1) != totalUnidades))
                    {
                        nuevasUnidades += ".";
                        contadorTres = 3;
                    }
                    else
                    {
                        contadorTres--;
                    }
                    temp++;
                }
            }
            if (todo.length == 2)
            {
                nuevasUnidades += ","+todo[1];
            }
            return nuevasUnidades+"%";
        }
        else
        {
            return valor+"%";
        }
    };
