function transformUrlString(_path, list)
{
    var cont;
    var buscador;
    for (cont = 0; cont < list.length; cont++) 
    {
        buscador = _path.search(list[cont][0]);
        while (buscador != -1)
        {
           _path = _path.replace(list[cont][0], list[cont][1]);
           buscador = _path.search(list[cont][0]);
        }
    }
    return _path;
}
function getThisUrl()
{
    var thisUrl = window.location.pathname;

    thisDashPath = thisUrl;
    var replaceStringList = [["\%3A", "\/"], ["\%20", " "], ["\%C3\%81", "Á"], ["\%C3\%89", "É"], ["\%C3\%8D", "Í"], ["\%C3\%91", "Ñ"], ["\%C3\%93", "Ó"], ["\%C3\%9A", "Ú"], ["\%C3\%9C", "Ü"], ["\%C3\%A1", "á"], ["\%C3\%A9", "é"], ["\%C3\%AD", "í"], ["\%C3\%B1", "ñ"], ["\%C3\%B3", "ó"], ["\%C3\%BA", "ú"], ["\%C3\%BC", "ü"]];
    thisDashPath = transformUrlString(thisDashPath, replaceStringList);
    
    thisDashPath = thisDashPath.replace("\.wcdf\/generatedContent", "");
    thisDashPath = thisDashPath.replace("\/pentaho\/api\/repos\/", "");

    thisDashName = thisDashPath.split(/[\/]+/).pop();
    var parts = thisDashPath.split(thisDashName);
    if (parts.length > 1) 
    {
        parts[parts.length - 2] += parts.pop();
    }
    thisDashPath = parts.join(thisDashName);
}

