function validateQueryParameters()
{
    var largo = queryParameterArray.length;
    var contador = 0;
    var parameterName;
    var parameterName_select;
    var parameterValue;
    var parameterValue_select;
    while(contador < largo)
    {
        parameterName = queryParameterArray[contador][0];
        parameterName_select = queryParameterArray[contador][1];

        parameterValue = Dashboards.getComponent(parameterName);
        parameterValue_select = Dashboards.getComponent(parameterName_select);

        if (parameterValue == "sin valor")
        {
            return false;
        }
        contador++;
    }
    return true;
}

function updateChartsWithQueryComponent()
{
    
    var largo = raphaelChartArray.length;
    var temp  = 0;
    while (temp<largo)
    {
        raphaelChartArray[temp].update();
        temp++;
    }
}

function chargeChartsWithQueryComponent()
{
    var correct = false;
    function tryMethod()
    {
        correct = validateQueryParameters();
        if(correct)
        {
            updateChartsWithQueryComponent();
        }
        else
        {
            setTimeout(tryMethod, 1000);
        }
    }
    tryMethod();
}

//agrega los componentes graficos ubicados en el arreglo "chartArray" de manera predterminada
function setCharts()
{
    Dashboards.addComponents(chartArray);
    setTimeout(function()
    {
        Dashboards.updateAll(chartArray);
    }, 1000 );
}